import React from 'react';
import { Outlet, Link } from 'react-router-dom';
import '../styles/Navbar.css';

const Navbar = () => {

    return (
        <div className='navbar'>
            <Link to="/">
                Home
            </Link>
            <Link to="/arena">
                Arena Deck Builder
            </Link>
            <Link to="deck">
                Deck Builder
            </Link>
            <Link to="cards">
                Card List
            </Link>
            <Outlet />
        </div>)
    ;
};

export default Navbar;
